create database ipa;
use ipa;

create table article
(
  id int NOT NULL
  AUTO_INCREMENT PRIMARY KEY,
  title varchar
  (50),
  readDuration varchar
  (255),
  dateUploaded varchar
  (8),
  tags varchar
  (255),
  thumbnail longtext,
  content longtext
);

  alter table article modify column readDuration smallint;
  alter table article modify title varchar
  (255);

  insert into article
    (title, readDuration, dateUploaded, tags, thumbnail, content)
  values
    ("SA Government calls for Electric Vehicle road user charge in 2020-21 Budget", 2, "13/11/20", "['ECONOMY', 'BUDGETS']",
      "",
      "On Tuesday, the South Australian Treasurer Rob Lucas handed down his
          governments 2020-21 Budget. This outlines the states economic
          recovery strategy from COVID-19, of which infrastructure forms a major
          component. The Budget allocates approximately $13.5 billion in general
          government expenditure to infrastructure over the next four years, an
          increase of around $3.7 billion or 38 per cent compared to the
          previous Budget. Reflecting the hit to the SA economy due to COVID-19
          and the governments fiscal stimulus, the Budget has recorded a $1.5
          billion deficit for FY2019-20 and projects a deficit of $2.6 billion
